function TavernPublish() {


    const items = JSON.parse(window.localStorage.getItem('TavernItems'));
    console.log(items);



    return (
        <div >
            <h1 className='title'>Tavern</h1>
            <div className='itemsContainer'>

                    {items.map(item => (
                        <div key={item.id} className="items">
                            <span>
                                <h1 className='itemNames'>{item.value}</h1>
                                <span key={item.id} className="itemCost">
                                    <span className="cost-published">{item.cost}</span>
                                    <span className="coinType=Published">{' ' + item.coinType}</span>








                                </span>
                            </span>
                        </div>
                ))}

            </div>
        </div>
    );
}




export default TavernPublish;
